import React from 'react';
import './Share.css'
const Share = () => {
    return (
        <div className='share'>
          <div className="shareWrapper">
            <div className="shareTop"></div>
            <div className="sharebuttom"></div>
          </div>
        </div>
    );
}

export default Share;
